import { Component } from '@angular/core';
import { HttpClientModule } from '@angular/common/http';
import { UserdataService } from 'src/app/userdata.service';

@Component({
  selector: 'app-adduser',
  templateUrl: './adduser.component.html',
  styleUrls: ['./adduser.component.css']
})
export class AdduserComponent {

   newUser = {
    name : '',
    email: '',
    password: '',
    role: '',
  };
  constructor(private userDataService : UserdataService) {}

  createUser() {
    

    this.userDataService.addUser(this.newUser).subscribe(
      (response) => {
        console.log('User created successfully:', response.user);
        // Handle success
      },
      (error) => {
        console.error('Error creating user:', error);
        // Handle error
      }
    );
    
    }
  }
<app-navigation></app-navigation>

<div class="registration-form">
    <form class="bg-light" (submit)="createUser()">
        <div class="form-icon">
            <span><i class="bi bi-person-fill-add"></i></span>
        </div>
        <div class="text-center headingdiv bg-primary-subtle fs-3 font-monospace">
            <span>Add Officer Details</span>
        </div>
        <br>
        <div class="form-group">
            <input type="text" class="form-control item" id="username" placeholder="Name" [(ngModel)]="newUser.name">
        </div>
        <div class="form-group">
            <select id="disabledSelect" class="form-select item" [(ngModel)]="newUser.role">
                <option>Training Head</option>
                <option>Placement Officer</option>
            </select>
        </div>
        <div class="form-group">
            <input type="text" class="form-control item" id="email" placeholder="Email" [(ngModel)]="newUser.email">
        </div>
        <div class="form-group">
            <input type="password" class="form-control item" id="password" placeholder="Password" [(ngModel)]="newUser.password">
        </div>
        <div class="form-group d-flex justify-content-evenly">
            <button type="submit" class="btn btn-block add-account"><i class="bi bi-person-fill-add"></i> Add</button>
            <button type="button" routerLink="/viewuser" class="btn btn-block discard-account"><i class="bi bi-x-circle-fill"></i> Discard</button>
        </div>
    </form>
</div>

<!-- scriptfiles -->
<script type="text/javascript" src="https://code.jquery.com/jquery-3.2.1.min.js"></script>
<script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/jquery.mask/1.14.15/jquery.mask.min.js"></script>
